import { connect } from 'react-redux';
import Component from './Component.js';
import * as actions from './Action.js';
import * as actionsCustomers from '././../user/traveler/Action.js';
import * as actionsAlert from '../../component/Alert/Action.js';

const mapStateToProps = state => {
  return {
    ...state
  }
}

const mapDispatchToProps = dispatch => {
  return { dispatch, actions, actionsAlert, actionsCustomers};
};

export default connect(
  mapStateToProps,
  mapDispatchToProps
)(Component);
